  deleteProblemLevel: "Deletar o n\u00edvel do problema",
  demotionProblemEmailBannedBody: "<p>Prezado <strong>%(user_name)</strong>:</p><p>O acesso ao seu problema <strong>%(problem_name)</strong> no omegaUp foi restrito porque foi relatado como inadequado. A equipe omegaUp analisou este relat\u00f3rio e confirmou que o problema n\u00e3o \u00e9 apropriado porque <em>%(reason)<em>.</p><p>Para desbloquear o problema e exibi-lo novamente na lista de problemas, siga as etapas abaixo:</p><p><ol><li>Revise e edite seu problema: certifique-se de descrever um problema, n\u00e3o \u00e9 ofensivo ou spam.</li><li>Depois de ter resolvido o motivo de por que seu problema foi bloqueado, envie um email <a href=\"mailto:quality@omegaup.com\" target=\"_top\">quality@omegaup.com</a> para ser revisado e reativado.</li></ol></p><p>Se as etapas mencionadas acima n\u00e3o forem seguidas, o problema n\u00e3o ser\u00e1 mostrado novamente na lista de problemas, nem pode ser usado em competi\u00e7\u00f5es. Em caso de reca\u00edda em tr\u00eas ocasi\u00f5es, omegaUp reserva-se o direito de suspender sua conta de usu\u00e1rio.</p><p>omegaUp \u00e9 uma plataforma para ajudar os usu\u00e1rios a melhorar suas habilidades de engenharia de software, resolvendo problemas de c\u00f3digo e competindo em concursos de programa\u00e7\u00e3o. omegaUp congratula-se com todos os problemas que ajudam a atingir esse objetivo.</p><p>Obrigado,</p><p>Equipe omegaUp</p>",
  demotionProblemEmailBannedSubject: "O problema [%(problem_name)] foi relatado como inadequado",
  demotionProblemEmailWarningBody: "<p>Prezado %(user_name):</p><p>O acesso ao seu problema% (problem_name) no omegaup.com foi marcado com um aviso porque foi relatado pelos usu\u00e1rios. A equipe omegaUp analisou este relat\u00f3rio e confirmou que o problema tem alguns aspectos que podem ser aprimorados porque %(reason).</p><p>Para remover a notifica\u00e7\u00e3o de aviso do problema e retorn\u00e1-lo ao normal, siga as etapas abaixo:</p><p><ol><li>Revise e edite seu problema.</li><li>Depois de ter resolvido o motivo de por que seu problema foi relatado, envie um email quality@omegaup.com para ser revisado.</li></lo></p><p>Se as etapas mencionadas acima n\u00e3o forem seguidas, o problema mostrar\u00e1 um sinal de aviso na lista de problemas.</p><p>omegaUp \u00e9 uma plataforma para ajudar os usu\u00e1rios a melhorar suas habilidades de engenharia de software, resolvendo problemas de c\u00f3digo e competindo em concursos de programa\u00e7\u00e3o. omegaUp congratula-se com todos os problemas que ajudam a atingir esse objetivo.</p><p>Obrigado,</p><p>Equipe omegaUp</p>",
